function getDataFromFile() {
    const lines = getFileString().split('\n'); // outputs the content of the text file

    let data = {};
    let chapter_data = [];
    let book = 'genesis';

    // Reading from file assumed to be already done and lines stored in an array called 'lines'
    for (let line of lines) {
        let info = line.split(' ');
        if (book !== info[0]) {
            data[book] = chapter_data;
            chapter_data = [];
        }

        book = info[0];
        let verses_info = line.slice(book.length + info[1].length + 2).trim();
        let verses = verses_info.slice(2, -2).split('], [');
        for (let i = 0; i < verses.length; i++) {
            verses[i] = verses[i].split(', ');
            for (let j = 0; j < verses[i].length; j++) {
                if (verses[i][j] !== '') {
                    verses[i][j] = parseInt(verses[i][j], 10);
                }
            }
        }
        chapter_data.push(verses);
    }
    data[book] = chapter_data;

    return data;
}

function wordLen(word) {
    /*
    Counts the length of a word without counting the diacritics/niqqud.
    */

    let length = 0;
    for (let symbol of word) {
        let s = symbol.charCodeAt(0);

        if (!(s >= 0x0591 && s <= 0x05C7)) {
            length += 1;
        }
    }

    return length;
}

function getLanguage(book) {
    const greek_books = [
        'matthew', 'mark', 'luke', 'john', 'acts', 'romans', '1_corinthians', '2_corinthians',
        'galatians', 'ephesians', 'philippians', 'colossians', '1_thessalonians', '2_thessalonians',
        '1_timothy', '2_timothy', 'titus', 'philemon', 'hebrews', 'james', '1_peter', '2_peter',
        '1_john', '2_john', '3_john', 'jude', 'revelation'
    ];

    return greek_books.includes(book) ? 'Greek' : 'Hebrew';
}

function capitaliseName(book) {
    return book.split(' ').map(word => word.charAt(0).toUpperCase() + word.slice(1)).join(' ');
    /*
    book = book.split(' ');
    for (let i = 0; i < book.length; i++) {
        book[i] = book[i].charAt(0).toUpperCase() + book[i].slice(1).toLowerCase();
    }
    book = book.join(' ');

    return book;
    */
}

